import React, { Component } from "react";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";


const styles = {
  search: {
    position: "relative",
    backgroundColor: "rgba(63, 127, 191, 0.38)",
    marginRight: 'auto',
    marginLeft: 'auto',
    width: "100%",
  },
  searchIcon: {
    paddingLeft: 6,
    height: "100%",
    position: "absolute",
    pointerEvents: "none",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  toolbar: {

  },
};

export default class NavBar extends Component {
  render() {
    return (
      <div id="Nav-Bar">
        <AppBar position="static" color="#992a08a">
          <Toolbar style={styles.toolbar}>
            <div id="search-bar" style={styles.search}>

            </div>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}
